        <>
            <Bar />
            <div className="container mt-5">

                <select onChange={handleChange} className="btn btn-light border border-dark dropdown-toggle"  >
                    <option >Select City</option>
                    {
                        city.map(() => {
                            return (

                                // <option onChange={setAcity(item.city)} key={item.city}><a href="{item}">{item}</a></option>
                                <option>{city}</option>
                            )
                        })
                    }
                </select>
                <button className="btn btn-primary" onClick={ambulancedata}>Search</button>
            </div>

            <div className="container mt-5">
                {
                    data.map((ambulance) => {
                        return (
                            <table className="table table-bordered">
                                <tr>
                                    <th>Driver Name</th>
                                    <th>Ambulance Registration Number</th>
                                    <th>Ambulance (RTO) Number</th>
                                    <th>Email</th>
                                    <th>Contact Number</th>
                                    <th>State</th>
                                    <th>City</th>
                                    <th>Pincode</th>
                                    <th>Availabilty Status</th>
                                </tr>
