                                    <td>{ambulance.drivername}</td>
                                    <td>{ambulance.aregno}</td>
                                    <td>{ambulance.avehicalno}</td>
                                    <td>{ambulance.email}</td>
                                    <td>{ambulance.mono}</td>
                                    <td>{ambulance.state}</td>
                                    <td>{ambulance.city}</td>
